export function France(ctx) {
  ctx.fillStyle = "#0055A4";
  ctx.fillRect(0, 70, 40, 90);

  ctx.fillStyle = "#FFFFFF";
  ctx.fillRect(40, 70, 40, 90);

  ctx.fillStyle = "#EF4135";
  ctx.fillRect(80, 70, 40, 90);
}
